import React from 'react';
import infologo from '../../assets/personal-info.jpg';
import memberlogo from '../../assets/memberpic.svg';

const Jachaikoron = () => {
    return (
        <div className='mx-auto max-w-3xl min-h-screen mt-4'>
           <div>
            <img src={infologo} alt="" className='max-h-20 w-full md:max-h-32 lg:max-h-40' />
           </div>
        </div>
    );
};

export default Jachaikoron;
